namespace Aevatar.Application.Grains.Tests.WebHook;

public class AppleStoreWebhookHandlerTests : AevatarOrleansTestBase<AevatarGodGPTTestsMoudle>
{
    private readonly ITestOutputHelper _testOutputHelper;

    
    private static readonly string AppleNotificationProcessorGrainId = "AppleNotificationProcessorGrainId_1";

    public AppleStoreWebhookHandlerTests(ITestOutputHelper testOutputHelper)
    {
        _testOutputHelper = testOutputHelper;
    }

    [Fact]
    public async Task HandleAsyncTest()
    {

        var transactionId = "2000000942293932";
        var userIdA = Guid.NewGuid();
        await CreateAppStoreSubscriptionAsync(userIdA, transactionId);
        
        var userIdA1 = Guid.NewGuid();
        var responseDto = await CreateAppStoreSubscriptionAsync(userIdA1, transactionId);
        responseDto.ShouldNotBeNull();
        responseDto.Success.ShouldBeFalse();
        responseDto.Error.ShouldBe("Transaction verification failed: invalid user data");

        var json = 
                "{\"signedPayload\":\"..Bc1xJ4_YAAlSo3FKdwkvhUtzsFrIbRk7ufOzkc0vFqxiiF0Z__IvzkGvIa6V5tFdZO_CwjLle5Ow0GcCAyy9wg\"}"
            ;
        json =
            "{\"signedPayload\":\"..bDdI11bY19ZabMUzbyB8PUtZyUbImLoITMIfuZ-v6OqxG8w-n9m1Ps0af_X9zS--yVxks04ISDt9G09nycwUqg\"}"
            ;
        json = 
            "{\"signedPayload\":\"..4nj4r15Ot_OArDe6JalYdXeHgf-XmWXMXe7YK0OWVwx2uhyynP7_UDCvZc5fU5jteMB4IzMrCqd3Hp56CcPGSg\"}"
            ;
        var appleEventProcessingGrain =  Cluster.GrainFactory.GetGrain<IAppleEventProcessingGrain>(AppleNotificationProcessorGrainId);
        var userIdB = await appleEventProcessingGrain.ParseEventAndGetUserIdAsync(json);
        userIdB.ShouldNotBe(default);
        userIdB.ShouldBe(userIdA);
        
        var userBillingGAgent = Cluster.GrainFactory.GetGrain<IUserBillingGAgent>(userIdA);
        var result = await userBillingGAgent.HandleAppStoreNotificationAsync(userIdA, json);
        result.ShouldBeTrue();

        var paymentHistory = await userBillingGAgent.GetPaymentHistoryAsync();
        paymentHistory.ShouldNotBeNull();
        paymentHistory.Count.ShouldBe(2);
    }
    
    [Fact]
    public async Task HandleAsyncTestJwtTokenTest()
    {

        for (int i = 0; i < 10; i++)
        {
            var transactionId = "2000000940378793";
            var userIdA = Guid.NewGuid();
            await CreateAppStoreSubscriptionAsync(userIdA, transactionId);
        }
    }

    [Fact]
    public async Task GetAppStoreTransactionInfoAsyncTest()
    {
        var transactionId = "2000000939024249";
        var userId = Guid.NewGuid();
        var userBillingGAgent =  Cluster.GrainFactory.GetGrain<IUserBillingGAgent>(userId);
        var grainResult = await userBillingGAgent.GetAppStoreTransactionInfoAsync(transactionId, "SandBox");
        grainResult.ShouldNotBeNull();
    }

    [Fact]
    public async Task CreateAppStoreSubscriptionAsyncTest()
    {
        var transactionId = "2000000939299589";
        transactionId = "2000000939700961"; //异常ID
        var userId = Guid.NewGuid();
        await CreateAppStoreSubscriptionAsync(userId, transactionId);
        
        var userQuotaGAgent =  Cluster.GrainFactory.GetGrain<IUserQuotaGAgent>(userId);
        var subscription = await userQuotaGAgent.GetSubscriptionAsync();
        subscription.IsActive.ShouldBeFalse();
        subscription = await userQuotaGAgent.GetSubscriptionAsync(true);
        subscription.IsActive.ShouldBeTrue();

        var userBillingGAgent =  Cluster.GrainFactory.GetGrain<IUserBillingGAgent>(userId);
        var paymentSummaries = await userBillingGAgent.GetPaymentHistoryAsync();
        paymentSummaries.ShouldNotBeNull();
        paymentSummaries.Count.ShouldBe(1);
    }

    private async Task<AppStoreSubscriptionResponseDto> CreateAppStoreSubscriptionAsync(Guid userId, string transactionId)
    {
        
        var userBillingGAgent =  Cluster.GrainFactory.GetGrain<IUserBillingGAgent>(userId);
        var grainResult = await userBillingGAgent.CreateAppStoreSubscriptionAsync(new CreateAppStoreSubscriptionDto
        {
            UserId = userId.ToString(),
            SandboxMode = true,
            TransactionId = transactionId
        });
        grainResult.ShouldNotBeNull();
        return grainResult;
    }
}